description:
The extravagant cop Michael Dooley needs some help to fight a drug dealer who has tried to kill him. A &quot;friend&quot; gives him a dog named Jerry Lee, who has been trained to smell drugs. With his help, Dooley sets out to put his enemy behind the bars, but Jerry Lee has a personality of his own and works only when he wants to. On the other hand, the dog is quite good at destroying Dooley's car, house and sex-life...

